(342, 2128, 1, 'What’s On Tap', 'Every digital product has a story to tell. It’s our job to find it and tell it well.', '<p>While we were not meaning to rhyme, this statement holds true. The end goal is to connect with humans, and we use the basic principles of story to do just that. Browse our work, enjoy the visuals and discover what it takes to create something great.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-06-07 23:07:42', '2021-06-07 23:07:42', '3693db29-3563-4343-9d4d-80237ab6b211'),
